r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">UIN Sunan Kalijaga pada tanggal 26\r\nSeptember yang lalu, merayakan hari lahirnya yang ke-69. UIN Sunan Kalijaga\r\nmerupakan kampus Islam Negeri tertua di Indonesia, usia yang cukup matang\r\nsebagai kampus perjuangan. Karena secara historis, perguruan tinggi Islam telah\r\ndiperjuangkan oleh ulama bahkan sebelum Indonesia merdeka. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Dalam momentum Dies Natalis ke-69 UIN\r\nSunan Kalijaga menyelenggarakan Gowes (bersepeda) bersama Ikatan Keluarga\r\nAlumni Sunan Kalijaga (IKASUKA) baik pusat hingga Daerah. Rute gowes yang\r\nditempuh <i style=\"mso-bidi-font-style:normal\">start</i> dari kampus UIN Sunan\r\nKalijaga dan <i style=\"mso-bidi-font-style:normal\">finish</i> di Joglo Ayem\r\nTentrem, Kalasan Sleman.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Hadir dalam kesempatan Gowes tersebut,\r\nRektor UIN Sunan Kalijaga, Prof. Al-Makin dan Ketua Umum IKASUKA, Drs. Syaiful\r\nbahri Anshori. Kemudian turut serta dalam Gowes tersebut, Prof. Machasin, Prof.\r\nEma Marhumah, pejabat Struktural di lingkungan UIN Sunan Kalijaga, Sekjend\r\nIKASUKA, Dr. Abdul Rozaky, kemudian kawan-kawan alumni IKASUKA Daerah, baik\r\ndari Jatim, Jateng, Jabar, DKI Jakarta. Tak lupa pula para ketua Alumni KAGAMA\r\n(UGM) dan IKA UNY yang turut serta mengucapkan selamat atas Harlah UIN Sunan\r\nKalijaga.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Selain itu, hadir dalam kesempatan\r\ntersebut Bupati Sleman, Drs. H. Sri Purnomo, M.S.I dan turut memberikan\r\nDoorprize berupa sepeda bagi para peserta Gowes Dies Natalis ke-69 UIN Sunan\r\nKalijaga. Ternyata Bupati Sleman sendiri, merupakan Alumni Fakultas Tarbiyah\r\nIAIN Sunan Kalijaga. Kehadiran beliau semakin menambah riuh kemeriahan suasana\r\nGowes.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:.5in\"><img style=\"width: 745.5px;\" src=\"data:image/jpeg;base64,\" data-filename=\"a.jpg\"><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMar